import {withAmp,useAmp} from 'next/amp'
export default withAmp(function Index(props) {
    const isAmp = useAmp();
    <style jsx>
      {`
        p {
          color: blue;
        }
      `}
    </style>
    return <p>Welcome to the AMP only Index page!!</p>;

  },
  {hybrid:true}
  );
